<script>
"use strict";
var flam,sed,density,c,h,k,dustdata,qdata,maxflux;
var l,path,x,y,dy,svg,p={w:1000,h:600},obsdata=[];
var pos,cursorpos,chx,chy,chisq,E,params={};
var defaultlimits={x1:0,x2:30,y1:0,y2:5000};
var plotlimits=Object.assign({},defaultlimits);
var plotwidth=1000,plotheight=600;

// constants

c=299792458.;
h=6.6261e-34;
k=1.3806e-23;

// plot setup
svg=document.getElementById("sed");
svg.addEventListener("mousewheel",adjustmass);
svg.addEventListener("mousemove",showpos);
svg.addEventListener("mouseleave",hidepos);
pos=svg.createSVGPoint();
cursorpos=svg.createSVGPoint();
chx=svg.getElementById("chx");
chy=svg.getElementById("chy");

// load session
loadsession();

// plot

getobs();
calculate();

function calculate() {

// get inputs
  params.distance=document.getElementById("distance").value; // conv to cm
  params.dustmass=document.getElementById("dustmass").value; // conv to g
  params.temperature=parseFloat(document.getElementById("temperature").value);
  params.grainsize=document.getElementById("grainsize").value;
  params.species=document.getElementById("species").value;

// grain densities
  if (params.species=="silicates") { density=3.0; } else { density=2.2; }

// read the relevant data
  readdata();
  qdata=dustdata[params.species][params.grainsize];

// calculate the fluxes
  sed=[];
  maxflux=0;
  for (var i=0;i<qdata.length;i++) {
    flam=(params.dustmass*2.e33*3*qdata[i][1]/(4*density*params.grainsize)*blackbody_nu(qdata[i][0],params.temperature))/((params.distance * 3.086e24)**2) * 1.e33; // 1e4 for /cm to /um, 1e23 for Jy, 1e6 for uJy
    maxflux=Math.max(maxflux,flam);
    sed.push({wlen:qdata[i][0],flam:flam});
  }

// set limit if necessary
  if (document.getElementById("auto").checked) { plotlimits.y2=maxflux; }

// plot
  plot();
}

function plot() {
  var old,i,wlenstep,wlenstart,fluxstep,fluxstart,y_u,y_l;

  old=svg.getElementsByClassName("plot");
  while (old.length>0) { old[0].parentNode.removeChild(old[0]); }

  wlenstep=10**(Math.floor(Math.log10(plotlimits.x2-plotlimits.x1)-0.5));
  wlenstart=wlenstep*Math.ceil(plotlimits.x1/wlenstep);
  for (i=wlenstart;i<plotlimits.x2;i=i+wlenstep) {
    l=document.createElementNS('http://www.w3.org/2000/svg',"line");
    l.setAttributeNS(null,"x1",getx(i));
    l.setAttributeNS(null,"x2",getx(i));
    l.setAttributeNS(null,"y1",plotheight);
    l.setAttributeNS(null,"y2",plotheight+10);
    l.setAttributeNS(null,"class","plot");
    svg.append(l);
    l=document.createElementNS('http://www.w3.org/2000/svg',"text");
    l.setAttributeNS(null,"text-anchor","middle");
    l.setAttributeNS(null,"stroke","none");
    l.setAttributeNS(null,"fill","#aaaaaa");
    l.setAttributeNS(null,"class","plot");
    l.setAttributeNS(null,"x",getx(i));
    l.setAttributeNS(null,"y",plotheight+25);
    l.innerHTML=i;
    svg.append(l);
  }

// and flux lines similarly

  fluxstep=10**(Math.floor(Math.log10(plotlimits.y2-plotlimits.y1)));
  fluxstart=fluxstep*Math.ceil(plotlimits.y1/fluxstep);
  for (i=fluxstart;i<plotlimits.y2;i=i+fluxstep) {
    l=document.createElementNS('http://www.w3.org/2000/svg',"line");
    l.setAttributeNS(null,"x1",0);
    l.setAttributeNS(null,"x2",plotwidth);
    l.setAttributeNS(null,"y1",gety(i));
    l.setAttributeNS(null,"y2",gety(i));
    l.setAttributeNS(null,"class","plot");
    l.setAttributeNS(null,"stroke","#aaaaaa");
    l.setAttributeNS(null,"stroke-dasharray","6,2");
    svg.append(l);
    l=document.createElementNS('http://www.w3.org/2000/svg',"text");
    l.setAttributeNS(null,"stroke","none");
    l.setAttributeNS(null,"fill","#aaaaaa");
    l.setAttributeNS(null,"class","plot");
    l.setAttributeNS(null,"text-anchor","end");
    l.setAttributeNS(null,"alignment-baseline","middle");
    l.setAttributeNS(null,"x",-5);
    l.setAttributeNS(null,"y",gety(i)-5);
    if (i<1) {
      l.innerHTML=i.toFixed(2);
    } else {
      l.innerHTML=i;
    }
    svg.append(l);
  }

// observations

  chisq=0.0;
  for (i=0;i<obsdata.length;i++) {
    if (obsdata[i].u<obsdata[i].flam) {
      E=interpolate(obsdata[i].wlen);
      chisq=chisq+(((obsdata[i].flam-E)/obsdata[i].u)**2);
    }

    x=getx(obsdata[i].wlen);
    y=gety(obsdata[i].flam);
    y_u=gety(obsdata[i].flam+obsdata[i].u);
    y_l=gety(obsdata[i].flam-obsdata[i].u);

    l = document.createElementNS('http://www.w3.org/2000/svg',"circle");
    l.setAttributeNS(null,"cx",x);
    l.setAttributeNS(null,"cy",y);
    l.setAttributeNS(null,"r",3);
    l.setAttributeNS(null,"class","plot");
    svg.append(l);

    l = document.createElementNS('http://www.w3.org/2000/svg',"path");
    path="M "+x+" "+y_l+" L "+x+" "+y_u+" m -10 0 l 20 0 M "+x+" "+y_l+" m -10 0 l 20 0";
    l.setAttributeNS(null,"d",path);
    l.setAttributeNS(null,"fill","none");
    l.setAttributeNS(null,"class","plot");
    svg.append(l);
  }
  svg.getElementById("chisq").innerHTML="&chi;^2="+chisq.toPrecision(4);

// SED

  for (i=0;i<sed.length;i++) {
    x=getx(sed[i].wlen);
    y=gety(sed[i].flam);
    if (i==0) {
      path="M "+x+" "+y;
    } else {
      path+=" L "+x+" "+y;
    }
  }

  l = document.createElementNS('http://www.w3.org/2000/svg',"path");
  l.setAttributeNS(null,"d",path);
  l.setAttributeNS(null,"fill", "none");
  l.setAttributeNS(null,"stroke-width", 2);
  l.setAttributeNS(null,"class","plot");
  l.setAttributeNS(null,"id","calc");
  svg.append(l);

// save params

  localStorage.setItem("dustparams",JSON.stringify(params));

}

function getx(wlen) {
  return p.w*(wlen/(plotlimits.x2-plotlimits.x1));
}

function gety(flux) {
// flux plotted over sensible range using maxflux
  return p.h*(1-(flux/(plotlimits.y2-plotlimits.y1)));
}

function getwlen(x) {
// get wavelength from svg position
  return (plotlimits.x2-plotlimits.x1)*(x/p.w);
}

function getflux(y) {
// get flux from y position
  return (plotlimits.y2-plotlimits.y1)*(1-y/p.h);
}

function blackbody_nu(wlen,temperature) {
  var freq,logboltz,boltzm1,bb_nu;

  freq=c*1e6/wlen;
  logboltz = (h*freq)/(k*temperature);
  boltzm1 = Math.expm1(logboltz);
  bb_nu = (2.0*h*freq**3)/(c**2*boltzm1);
  return 1e3*bb_nu;
}

function adjustmass(e) {
// change abundance of ion from mousewheel
  e.preventDefault();
  var inc = Math.sign(-e.deltaY || e.wheelDelta || -e.detail);
  var newdustmass=params.dustmass*10**(0.01*inc);
  var factor=newdustmass/params.dustmass;

  for (var i=0;i<sed.length;i++) {
    sed[i].flam=sed[i].flam*factor;
  }

  params.dustmass=newdustmass;
  document.getElementById("dustmass").value=newdustmass.toPrecision(2);
  if (document.getElementById("auto").checked) { plotlimits.y2=plotlimits.y2*factor; }
  plot();
}

function getobs() {
  var line;
  var input=document.getElementById("obsdata").value;
  input=input.replace(/[^0-9\. \t\n]/g,"");
  input=input.split("\n");

  obsdata=[];
  for (var i=0;i<input.length;i++) {
    if (input[i]!=="") {
      line=input[i].split(/[ \t]+/);
      obsdata.push({wlen:parseFloat(line[0]),flam:parseFloat(line[1]),u:parseFloat(line[2])});
    }
  }
}

function showpos(e) {
  e=e||window.event;
  pos.x=e.clientX;
  pos.y=e.clientY;
  cursorpos=pos.matrixTransform(svg.getScreenCTM().inverse());
  chx.setAttributeNS(null,"y1",cursorpos.y);
  chx.setAttributeNS(null,"y2",cursorpos.y);
  chy.setAttributeNS(null,"x1",cursorpos.x);
  chy.setAttributeNS(null,"x2",cursorpos.x);
  info.innerHTML=getwlen(cursorpos.x).toFixed(2)+"&mu;m, "+getflux(cursorpos.y).toPrecision(4)+"&mu;Jy";
}

function hidepos() {
  chx.setAttributeNS(null,"y1",-999);
  chx.setAttributeNS(null,"y2",-999);
  chy.setAttributeNS(null,"x1",-999);
  chy.setAttributeNS(null,"x2",-999);
  info.innerHTML="";
}

function loadsession() {
  var defaults={dustmass:0.05,species:"silicates",temperature:240,grainsize:"1.000E-1",distance:24};
  params=JSON.parse(localStorage.getItem("dustparams")) || defaults;
  for (x in params) {
    document.getElementById(x).value=params[x];
  }
}

function interpolate(wlen) {
// return linearly interpolated flux given a wavelength
// nb that because data is tabulated in decreasing wavelength order, SED is also in that order
  if (wlen<0) { return sed[sed.length-1].flam; }
  if (wlen>sed[0].wlen) { return sed[0].flam; }
  for (var i=0;i<sed.length;i++) {
    if (sed[i].wlen<wlen) { break; }
  }
  var interp=(wlen-sed[i-1].wlen)/(sed[i].wlen-sed[i-1].wlen);
  return sed[i-1].flam+interp*(sed[i].flam-sed[i-1].flam);
}

function switchaxes() {
// allow/disallow manual axis setting
  var boxes=document.getElementsByClassName("axin");
  var disable=document.getElementById("auto").checked;
  for (var i=0;i<boxes.length;i++) {
    boxes[i].disabled=disable;
    if (disable) {
      boxes[i].value=defaultlimits[boxes[i].id];
    } else {
      plotlimits[boxes[i].id]=boxes[i].value;
    }
  }
  plotlimits.y2=disable?maxflux:plotlimits.y2;
  plot();
}

function setlimits(e) {
  plotlimits[e.target.id]=parseFloat(e.target.value);
  plot();
}

function optimise() {
// find best combination of dust mass and temperature all else being equal

  var best={i:null,j:null};
  var bestchisq=9e99;
  var massdiff,tdiff;

  var searchspace={massmin:0.001,massmax:1,tmin:130,tmax:500};

// search

  for (var pass=0;pass<5;pass++) {
    massdiff=0.1*(searchspace.massmax-searchspace.massmin);
    tdiff=0.1*(searchspace.tmax-searchspace.tmin);
    for (var i=1;i<11;i++) {
      for (var j=1;j<11;j++) {
        document.getElementById("dustmass").value=searchspace.massmin+i*massdiff;
        document.getElementById("temperature").value=searchspace.tmin+j*tdiff;
        calculate();
        if (chisq<bestchisq) {
          bestchisq=chisq;
          best={i:i,j:j};
        }
      }
    }
console.log("search pass "+pass+". bestchisq="+bestchisq);
    searchspace.massmin=searchspace.massmin+(best.i-1)*massdiff;
    searchspace.massmax=searchspace.massmin+(best.i+1)*massdiff;
    searchspace.tmin=searchspace.tmin+(best.j-1)*tdiff;
    searchspace.tmax=searchspace.tmin+(best.j+1)*tdiff;
console.log("new search space: "+JSON.stringify(searchspace));
  }

// show best

  document.getElementById("dustmass").value=searchspace.massmin+(best.i)*massdiff;
  document.getElementById("temperature").value=searchspace.tmin+(best.j)*tdiff;
  calculate();

}
